import 'package:chatbase_app/constants.dart';
import 'package:flutter/material.dart';
import 'package:flutter_svg/flutter_svg.dart';

class AddSocialIconButton extends StatelessWidget {
  final String iconSrc;
  final String? title;
  final Function() onPressed;
  const AddSocialIconButton(
      {Key? key, required this.iconSrc, this.title, required this.onPressed})
      : super(key: key);

  @override
  Widget build(BuildContext context) {
    return Container(
      margin: const EdgeInsets.only(right: 10.0),
      child: OutlinedButton(
        onPressed: onPressed,
        child: SvgPicture.asset(iconSrc, height: 20.0, color: kPrimaryColor),
        style: ButtonStyle(
          shape: MaterialStateProperty.all(
            RoundedRectangleBorder(
              borderRadius: BorderRadius.circular(29.0),
            ),
          ),
          side: MaterialStateProperty.all(
              const BorderSide(color: kPrimaryLightColor)),
          overlayColor: MaterialStateProperty.resolveWith<Color?>(
            (states) {
              if (states.contains(MaterialState.pressed)) {
                return kPrimaryLightColor;
              }
              return null;
            },
          ),
        ),
      ),
    );
  }
}
